eCode":"fy","languageName":{"simpleText":"Western Frisian"}},{"languageCode":"wo","languageName":{"simpleText":"Wolof"}},{"languageCode":"xh","languageName":{"simpleText":"Xhosa"}},{"languageCode":"yi","languageName":{"simpleText":"Yiddish"}},{"languageCode":"yo","languageName":{"simpleText":"Yoruba"}},{"languageCode":"zu","languageName":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"tgbNymZ7vqY","title":"Bohemian Rhapsody | Muppet Music Video | The Muppets","lengthSeconds":"286","keywords":["New","Muppets","Studio","Muppet","Show","Gonzo","Camilla","Chickens","Rowlf","Animal","Pepe","King","Prawn","Monsters","Bunny","Beaker","Bobo","Bear","Penguins","Dr.","Bunsen","Honeydew","Mahna","Snowths","Lew","Zealand","Beauregard","Crazy","Harry","Fozzie","Statler","Waldorf","Sam","Eagle","Swedish","Chef","Turkey","Electric","Mayhem","Floyd","Teeth","Zoot","Janice","Julius","Strangepork","Newsman","Sal","Minella","Johnny","Fiama","Miss","Piggy","Scooter","Kermit","Frog","Queen","Bohemian","Rhapsody","Freddie","Mercury","Brian","May","Roger","Taylor","John","Deacon","Opera","Rock","Roll","Music","Musical","Singing","virmup","virmupHD"],"channelId":"UCB0ABGbdSggBXLF0UdN4d5A","isOwnerViewing":false,"shortDescription":"The Muppets' Musical Gang is back at it with their rendition of Queen’s Bohemian Rhapsody!\n\nSubscribe for all new videos from The Muppets! ► http://www.youtube.com/subscription_center?add_user=MuppetsStudios \nWatch more Muppet Music Videos► https://www.youtube.com/playlist?list=PLiyHgXXaitUHx0Jpt9tW1k0ZZuydnNORl\n\nInspired by one off the all time greats, QUEEN, the Muppets present their rendition of the classic, \"Bohemian Rhapsody.\" Originally released in 1975, this classic with a Muppets Twist is sure to keep every music lover, and Muppet fan satisfied. \nWatch more of the best moments, music videos, and laughs from The Muppets! ► https://www.youtube.com/playlist?list=PLiyHgXXaitUEgAKvEzfsV1GTgJnrcy0j3\n\nGet more from The Muppets!\nhttp://disney.com/muppets\nFacebook: https://www.facebook.com/Muppets\nTwitter: http://www.twitter.com/MuppetsStudio\nTumblr: http://themuppets.tumblr.com\nInstagram: http://www.instagram.com/themuppets\n\nMuppets Characters\nGonzo is a multi-talented artist who performs outrageous daredevil stunts. Though an odd looking creature, Gonzo takes pride in his uniqueness and enjoys every adventure he goes on with the Muppets including the occasional space voyage. \n\nRowlf the Dog is the Muppet’s resident piano player. One of the Muppets oldest characters, Rowlf rose to stardom by first plugging advertisements for his favorite dog-food brands on the original Muppets show. Rowlf the Dog is not the trusty Muppets sidekick  always ready to help Kermit the Frog, Fozzie Bear, Miss Piggy, and the rest of the Muppets. \n\nAnimal is the wild drummer for the almost-legendary band, Dr. Teeth and The Electric Mayhem, who are the regular performers traveling with the Muppets. Animal is the official musical Muppet. Known for his outrageous style and unclear speaking voice, Animal is a crazed percussionist with three music style - loud, louder and loudest.\n\nPepe the King Prawn, lovingly known as Pepe, comes to the Muppets from Spain. Pepe moved to Hollywood to pursue his one true calling show business. Peep’s strong spanish accent makes it difficult for him to be understood.\n\nNot one to leave the Muppet Lab too often, Beaker is the accident-prone assistant to Dr. Bunsen Honeydew. Though often difficult to understand, due to his “Meep”, Beaker is known among the Muppets as the one who always gets hurt. \n\nWhen the Muppets made it big, they needed to hire a fool-proof security guard. Thus, Bobo the Bear became head of Muppets security. \n\nDr. Bunsen Honeydew and his assistant Beaker are the resident scientists of the Muppets experimenting away in the Muppets Lab. Bunsen is always eager to show off his latest scientific discoveries to the Muppets. \n\nFozzie Bear is the world’s funniest—and only— stand-up comedy bear. From his beat-up hat to the “wocka wocka” that punctuates his punchlines, Fozzie is an “old school” comic. His jokes aren’t always great, but they are delivered with heart and Fozzie’s signature pazazz. \n\nMiss Piggy is the ultimate diva, leading lady, fashion icon, star of stage, screen, and all media known and unknown in perpetuity throughout the universe. Miss Piggy has an appetite for the good things in life, including chocolate, jewelry, awards, and above all, her one true love, Kermit the Frog.\n\nKermit is the world’s most famous frog, but he has never let  international success go to his head. Arguably one of Jim Henson’s most famous Muppet creations, Kermit the Frog has come a long way from his home, the swamp, to become one of TV’s most beloved characters. \n\nMuppet Music Videos\nOnly on the official YouTube channel for The Muppets can you see the classic Muppets music videos, exclusive cuts of Muppets music, and all new original Muppets song covers! Check out classic Muppets music videos like The Muppets cover of Queen’s “Bohemian Rhapsody”  and The Muppets music videos for “Jungle Boogie”, as performed by Dr. Teeth and the Electric Mayhem. \n\nThe Muppets on YouTube\nWelcome to the Official YouTube channel for The Muppets! This channel is home to your beloved group of Muppet friends: Kermit the Frog, Miss Piggy, Fozzie Bear, Gonzo, Animal, Beaker, the Swedish Chef and more! Subscribe for some of your favorite and best film and television clips from The Muppets, as well as music covers and brand new comedy sketches.\n\nCheck out exclusive Muppet parodies, Muppet music videos, Muppet song covers, comedy sketches, and more! Join in the fun with original Muppet comedy shows, TV promos, and charity PSAs. Tune into the all new the Muppet show, “The Muppets” on Tuesday nights at 8|7c on ABC!","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/tgbNymZ7vqY/hqdefault.jpg?sqp=-oaymwE1CKgBEF5 /www.instagram.com/themuppets\n\nMuppets Characters\nGonzo is a multi-talented artist who performs outrageous daredevil stunts. Though an odd looking creature, Gonzo takes pride in his uniqueness and enjoys every adventure he goes on with the Muppets including the occasional space voyage. \n\nRowlf the Dog is the Muppet’s resident piano player. One of the Muppets oldest characters, Rowlf rose to stardom by first plugging advertisements for his favorite dog-food brands on the original Muppets show. Rowlf the Dog is not the trusty Muppets sidekick  always ready to help Kermit the Frog, Fozzie Bear, Miss Piggy, and the rest of the Muppets. \n\nAnimal is the wild drummer for the almost-legendary band, Dr. Teeth and The Electric Mayhem, who are the regular performers traveling with the Muppets. Animal is the official musical Muppet. Known for his outrageous style and unclear speaking voice, Animal is a crazed percussionist with three music style - loud, louder and loudest.\n\nPepe the King Prawn, lovingly known as Pepe, comes to the Muppets from Spain. Pepe moved to Hollywood to pursue his one true calling show business. Peep’s strong spanish accent makes it difficult for him to be understood.\n\nNot one to leave the Muppet Lab too often, Beaker is the accident-prone assistant to Dr. Bunsen Honeydew. Though often difficult to understand, due to his “Meep”, Beaker is known among the Muppets as the one who always gets hurt. \n\nWhen the Muppets made it big, they needed to hire a fool-proof security guard. Thus, Bobo the Bear became head of Muppets security. \n\nDr. Bunsen Honeydew and his assistant Beaker are the resident scientists of the Muppets experimenting away in the Muppets Lab. Bunsen is always eager to show off his latest scientific discoveries to the Muppets. \n\nFozzie Bear is the world’s funniest—and only— stand-up comedy bear. From his beat-up hat to the “wocka wocka” that punctuates his punchlines, Fozzie is an “old school” comic. His jokes aren’t always great, but they are delivered with heart and Fozzie’s signature pazazz. \n\nMiss Piggy is the ultimate diva, leading lady, fashion icon, star of stage, screen, and all media known and unknown in perpetuity throughout the universe. Miss Piggy has an appetite for the good things in life, including chocolate, jewelry, awards, and above all, her one true love, Kermit the Frog.\n\nKermit is the world’s most famous frog, but he has never let  international success go to his head. Arguably one of Jim Henson’s most famous Muppet creations, Kermit the Frog has come a long way from his home, the swamp, to become one of TV’s most beloved characters. \n\nMuppet Music Videos\nOnly on the official YouTube channel for The Muppets can you see the classic Muppets music videos, exclusive cuts of Muppets music, and all new original Muppets song covers! Check out classic Muppets music videos like The Muppets cover of Queen’s “Bohemian Rhapsody”  and The Muppets music videos for “Jungle Boogie”, as performed by Dr. Teeth and the Electric Mayhem. \n\nThe Muppets on YouTube\nWelcome to the Official YouTube channel for The Muppets! This channel is home to your beloved group of Muppet friends: Kermit the Frog, Miss Piggy, Fozzie Bear, Gonzo, Animal, Beaker, the Swedish Chef and more! Subscribe for some of your favorite and best film and television clips from The Muppets, as well as music covers and brand new comedy sketches.\n\nCheck out exclusive Muppet parodies, Muppet music videos, Muppet song covers, comedy sketches, and more! Join in the fun with original Muppet comedy shows, TV promos, and charity PSAs. Tune into the all new the Muppet show, “The Muppets” on Tuesday nights at 8|7c on ABC!"},"lengthSeconds":"287","ownerProfileUrl":"http://www.youtube.com/@MuppetsStudio","externalChannelId":"UCB0ABGbdSggBXLF0UdN4d5A","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM" agementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"The Muppets' Musical Gang is back at it with their rendition of Queen’s Bohemian Rhapsody!\n\nSubscribe for all new videos from The Muppets! ► http://www.youtube.com/subscription_c... \nWatch more Muppet Music Videos►    • *Muppets Music Videos | The Muppets  \n\nInspired by one off the all time greats, QUEEN, the Muppets present their rendition of the classic, \"Bohemian Rhapsody.\" Originally released in 1975, this classic with a Muppets Twist is sure to keep every music lover, and Muppet fan satisfied. \nWatch more of the best moments, music videos, and laughs from The Muppets! ►    • The Best of The Muppets! | The Muppets  \n\nGet more from The Muppets!\nhttp://disney.com/muppets\nFacebook:   / muppets  \nTwitter:   / muppetsstudio  \nTumblr:   / themuppets  \nInstagram:   / themuppets  \n\nMuppets Characters\nGonzo is a multi-talented artist who performs outrageous daredevil stunts. Though an odd looking creature, Gonzo takes pride in his uniqueness and enjoys every adventure he goes on with the Muppets including the occasional space voyage. \n\nRowlf the Dog is the Muppet’s resident piano player. One of the Muppets oldest characters, Rowlf rose to stardom by first plugging advertisements for his favorite dog-food brands on the original Muppets show. Rowlf the Dog is not the trusty Muppets sidekick  always ready to help Kermit the Frog, Fozzie Bear, Miss Piggy, and the rest of the Muppets. \n\nAnimal is the wild drummer for the almost-legendary band, Dr. Teeth and The Electric Mayhem, who are the regular performers traveling with the Muppets. Animal is the official musical Muppet. Known for his outrageous style and unclear speaking voice, Animal is a crazed percussionist with three music style - loud, louder and loudest.\n\nPepe the King Prawn, lovingly known as Pepe, comes to the Muppets from Spain. Pepe moved to Hollywood to pursue his one true calling show business. Peep’s strong spanish accent makes it difficult for him to be understood.\n\nNot one to leave the Muppet Lab too often, Beaker is the accident-prone assistant to Dr. Bunsen Honeydew. Though often difficult to understand, due to his “Meep”, Beaker is known among the Muppets as the one who always gets hurt. \n\nWhen the Muppets made it big, they needed to hire a fool-proof security guard. Thus, Bobo the Bear became head of Muppets security. \n\nDr. Bunsen Honeydew and his assistant Beaker are the resident scientists of the Muppets experimenting away in the Muppets Lab. Bunsen is always eager to show off his latest scientific discoveries to the Muppets. \n\nFozzie Bear is the world’s funniest—and only— stand-up comedy bear. From his beat-up hat to the “wocka wocka” that punctuates his punchlines, Fozzie is an “old school” comic. His jokes aren’t always great, but they are delivered with heart and Fozzie’s signature pazazz. \n\nMiss Piggy is the ultimate diva, leading lady, fashion icon, star of stage, screen, and all media known and unknown in perpetuity throughout the universe. Miss Piggy has an appetite for the good things in life, including chocolate, jewelry, awards, and above all, her one true love, Kermit the Frog.\n\nKermit is the world’s most famous frog, but he has never let  international success go to his head. Arguably one of Jim Henson’s most famous Muppet creations, Kermit the Frog has come a long way from his home, the swamp, to become one of TV’s most beloved characters. \n\nMuppet Music Videos\nOnly on the official YouTube channel for The Muppets can you see the classic Muppets music videos, exclusive cuts of Muppets music, and all new original Muppets song covers! Check out classic Muppets music videos like The Muppets cover of Queen’s “Bohemian Rhapsody”  and The Muppets music videos for “Jungle Boogie”, as performed by Dr. Teeth and the Electric Mayhem. \n\nThe Muppets on YouTube\nWelcome to the Official YouTube channel for The Muppets! This channel is home to your beloved group of Muppet friends: Kermit the Frog, Miss Piggy, Fozzie Bear, Gonzo, Animal, Beaker, the Swedish Chef and more! Subscribe for some of your favorite and best film and television clips from The Muppets, as well as music covers and brand new comedy sketches.\n\nCheck out exclusive Muppet parodies, Muppet music videos, Muppet song covers, comedy sketches, and more! Join in the fun with original Muppet comedy shows, TV promos, and charity PSAs. Tune into the all new the Muppet show, “The Muppets” on Tuesday nights at 8|7c on ABC!","commandRuns":[{"startIndex":141,"length":40,"onTap":{"innertubeCommand":{"clickTrackingParams":"CLMDEM2rARgBIhMItZiGvMHWiQMVzUtPBB1y6TXm","commandMetadata":{"webCommandMetadata":{"url":"http://www.youtube.com/subscription_center?add_user=MuppetsStudios","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"http://www.youtube.com/subscription_center?add_user=MuppetsStudios","nofollow":true}}}},{"startIndex":215,"length":42,"onTap":{"innertubeCommand":{"clickTrackingParams":"CLMDEM2rARgBIhMItZiGvMHWiQMVzUtPBB1y6TXm","commandMetadata":{"webCommandMetadata":{"url":"/playlist?list=PLiyHgXXaitUHx0Jpt9tW1k0ZZuydnNORl","webPageType":"WEB_PAGE_TYPE_PLAYLIST","rootVe":5754,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"VLPLiyHgXXaitUHx0Jpt9tW1k0ZZuydnNORl","canonicalBaseUrl":"/playlist?list=PLiyHgXXaitUHx0Jpt9tW1k0ZZuydnNORl"}}},"onTapOptions":{"accessibilityInfo":{"accessibilityLabel":"YouTube Channel Link: *Muppets Music Videos | The Muppets"}}},{"startIndex":582,"length":45,"onTap":{"innertubeCommand":{"clickTrackingParams":"CLMDEM2rARgBIhMItZiGvMHWiQMVzUtPBB1y6TXm","commandMetadata":{"webCommandMetadata":{"url":"/playlist?list=PLiyHgXXaitUEgAKvEzfsV1GTgJnrcy0j3","webPageType":"WEB_PAGE_TYPE_PLAYLIST","rootVe":5754,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"VLPLiyHgXXaitUEgAKvEzfsV1GTg ctoidRenderer":{"value":{"simpleText":"183,914,208"},"label":{"simpleText":"Views"},"accessibilityText":"183,914,208 views"}},"viewCountType":"VIEW_COUNT_FACTOID_TYPE_TOTAL_VIEWS"}},{"factoidRenderer":{"value":{"simpleText":"2009"},"label":{"simpleText":"Nov 24"},"accessibilityText":"Nov 24, 2009"}}],"channelNavigationEndpoint":{"clickTrackingParams":"CBYQ040EGAUiEwi1mIa8wdaJAxXNS08EHXLpNeY=","commandMetadata":{"webCommandMetadata":{"url":"/@MuppetsStudio","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCB0ABGbdSggBXLF0UdN4d5A","canonicalBaseUrl":"/@MuppetsStudio"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/Qdy4BEAtGyq7naT45fvsx9zrNMeucJ3x40NLWHmNU2aXE_IoxPHrYmHh398Ck7Hi8Jy1iQVKIw=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"accessibility":{"accessibilityData":{"label":"Show more"}},"simpleText":"...more"},"showLessText":{"simpleText":"Show less"},"attributedDescriptionBodyText":{"content":"The Muppets' Musical Gang is back at it with their rendition of Queen’s Bohemian Rhapsody!\n\nSubscribe for all new videos from The Muppets! ► http://www.youtube.com/subscription_c... \nWatch more Muppet Music Videos►    • *Muppets Music Videos | The Muppets  \n\nInspired by one off the all time greats, QUEEN, the Muppets present their rendition of the classic, \"Bohemian Rhapsody.\" Originally released in 1975, this classic with a Muppets Twist is sure to keep every music lover, and Muppet fan satisfied. \nWatch more of the best moments, music videos, and laughs from The Muppets! ►    • The Best of The Muppets! | The Muppets  \n\nGet more from The Muppets!\nhttp://disney.com/muppets\nFacebook:   / muppets  \nTwitter:   / muppetsstudio  \nTumblr:   / themuppets  \nInstagram:   / themuppets  \n\nMuppets Characters\nGonzo is a multi-talented artist who performs outrageous daredevil stunts. Though an odd looking creature, Gonzo takes pride in his uniqueness and enjoys every adventure he goes on with the Muppets including the occasional space voyage. \n\nRowlf the Dog is the Muppet’s resident piano player. One of the Muppets oldest characters, Rowlf rose to stardom by first plugging advertisements for his favorite dog-food brands on the original Muppets show. Rowlf the Dog is not the trusty Muppets sidekick  always ready to help Kermit the Frog, Fozzie Bear, Miss Piggy, and the rest of the Muppets. \n\nAnimal is the wild drummer for the almost-legendary band, Dr. Teeth and The Electric Mayhem, who are the regular performers traveling with the Muppets. Animal is the official musical Muppet. Known for his outrageous style and unclear speaking voice, Animal is a crazed percussionist with three music style - loud, louder and loudest.\n\nPepe the King Prawn, lovingly known as Pepe, comes to the Muppets from Spain. Pepe moved to Hollywood to pursue his one true calling show business. Peep’s strong spanish accent makes it difficult for him to be understood.\n\nNot one to leave the Muppet Lab too often, Beaker is the accident-prone assistant to Dr. Bunsen Honeydew. Though often difficult to understand, due to his “Meep”, Beaker is known among the Muppets as the one who always gets hurt. \n\nWhen the Muppets made it big, they needed to hire a fool-proof security guard. Thus, Bobo the Bear became head of Muppets security. \n\nDr. Bunsen Honeydew and his assistant Beaker are the resident scientists of the Muppets experimenting away in the Muppets Lab. Bunsen is always eager to show off his latest scientific discoveries to the Muppets. \n\nFozzie Bear is the world’s funniest—and only— stand-up comedy bear. From his beat-up hat to the “wocka wocka” that punctuates his punchlines, Fozzie is an “old school” comic. His jokes aren’t always great, but they are delivered with heart and Fozzie’s signature pazazz. \n\nMiss Piggy is the ultimate diva, leading lady, fashion icon, star of stage, screen, and all media known and unknown in perpetuity throughout the universe. Miss Piggy has an appetite for the good things in life, including chocolate, jewelry, awards, and above all, her one true love, Kermit the Frog.\n\nKermit is the world’s most famous frog, but he has never let  international success go to his head. Arguably one of Jim Henson’s most famous Muppet creations, Kermit the Frog has come a long way from his home, the swamp, to become one of TV’s most beloved characters. \n\nMuppet Music Videos\nOnly on the official YouTube channel for The Muppets can you see the classic Muppets music videos, exclusive cuts of Muppets music, and all new original Muppets song covers! Check out classic Muppets music videos like The Muppets cover of Queen’s “Bohemian Rhapsody”  and The Muppets music videos for “Jungle Boogie”, as performed by Dr. Teeth and the Electric Mayhem. \n\nThe Muppets on YouTube\nWelcome to the Official YouTube channel for The Muppets! This channel is home to your beloved group of Muppet friends: Kermit the Frog, Miss Piggy, Fozzie Bear, Gonzo, Animal, Beaker, the Swedish Chef and more! Subscribe for some of your favorite and best film and television clips from The Muppets, as well as music covers and brand new comedy sketches.\n\nCheck out exclusive Muppet parodies, Muppet music videos, Muppet song covers, comedy sketches, and more! Join in the fun with original Muppet comedy shows, TV promos, and charity PSAs. Tune into the all new the Muppet show, “The Muppets” on Tuesday nights at 8|7c on ABC!","commandRuns":[{"startIndex":141,"length":40,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBYQ040EGAUiEwi1mIa8wdaJAxXNS08EHXLpNeY=","commandMetadata":{"webCommandMetadata":{"url":"http://www.youtube.com/subscription_center?add_user=MuppetsStudios","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"http://www.youtube.com/subscription_center?add_user=MuppetsStudios","nofollow":true}}}},{"startIndex":215,"length":42,"onTap":{"innertubeCommand":{"clickTrack
